98.css:
.wrapper{
  margin:0 -92px 0 -80px;
  background: var(--color-direct-background-additional);
  padding:24px 0 12px 16px
}
.ya-units-slider{
  position:relative
}
.ya-units-slider:hover .ya-slider-button{
  opacity:.9;
  visibility:visible;
  transform:translate(0)
}
.ya-slider-button,.ya-slider-leftmost .ya-slider-button[data-direction=left],.ya-slider-rightmost .ya-slider-button[data-direction=right]{
  opacity:0;
  visibility:hidden
}
.ya-slider::after,.ya-slider::before{
  content:'';
  display:block;
  flex:1 0 auto
}
.ya-slider::before{
  width:56px
}
.ya-slider::after{
  width:40px
}
.ya-slider-button{
  position:absolute;
  top:0;
  background-color: var(--color-direct-background-primary);
  transition:.2s;
  padding:6px;
  font-size:0;
  line-height:0;
  box-shadow:0 2px 6px var(--color-direct-shadow);
  border-radius:4px;
  cursor:pointer;
  z-index:960;
  margin:68px 0
}
.ya-units-slider .ya-slider-button:hover{
  opacity:1
}
.ya-slider-button[data-direction=right]{
  right:20px;
  transform:translateX(5px)
}
.ya-slider-button[data-direction=left]{
  left:20px;
  transform:translateX(-5px)
}
.ya-slider-button[data-direction=left] svg{
  transform:rotate(180deg);
  transform-origin:center
}
.ya-slider-item{
  position:relative;
  border-radius:4px;
  overflow:hidden;
  flex:1 0 auto
}
.ad-age{
  position:absolute;
  top:4px;
  left:4px;
  z-index:1;
  font-size:10px;
  line-height:12px;
  font-family:Verdana,sans-serif;
  font-style:normal;
  font-weight:400;
  color: var(--color-direct-text-contrast);
  text-shadow:0 1px 1px var(--color-direct-shadow);
}
.age{
  position: absolute;
  left: 55px;
  top:3px;
}
.unit-wrapper{
  height:100%;
  padding:0 8px;
  width:228px
}
.ya-ad-close{
  width:16px;
  height:16px;
  padding:4px;
  opacity:1;
  background: var(--color-direct-background-translucent);
  border-radius:0;
  border-top-right-radius:4px
}
.unit{
  display:flex;
  flex-direction:column;
  flex-wrap:nowrap;
  box-sizing:border-box;
  font-family:"Helvetica Neue",sans-serif;
  border-radius: 4px;
  height: 100%;
}
.body,.image,.unit{
  position:relative
}
.image{
  width:100%;
  flex:0 0 auto;
  border-radius:4px;
  overflow:hidden
}
.image::after{
  content:'';
  position:absolute;
  top:0;
  left:0;
  width:100%;
  height:100%;
  background:radial-gradient(ellipse 80% 30% at 0 0,rgba(0,0,0,.1) 0,transparent 100%),radial-gradient(circle,transparent,rgba(0,0,0,.03),rgba(0,0,0,.08))
}
.body{
  display:flex;
  flex-direction:column;
  padding:16px 8px;
  flex:1
}
.clamp {
  overflow: hidden;
  text-overflow: ellipsis;
  -webkit-box-orient: vertical;
  display: -webkit-box;
  -webkit-line-clamp: 6;
  margin-bottom: 16px;
}
.title{
  color:var(--color-direct-text-primary);
  font-style:normal;
  font-weight:700;
  font-size:16px;
  line-height:20px;
  margin-bottom:12px
}
.button,.description{
  font-style:normal;
  font-size:12px
}
.description{
  font-weight:400;
  line-height:14px;
  color:var(--color-direct-text-secondary);
}
.button{
  margin-top:auto;
  display:inline-block;
  padding:6px 10px;
  background: var(--color-direct-button);
  border-radius:4px;
  color: var(--color-direct-button-text);
  font-weight:500;
  line-height:15px;
  align-self:flex-start
}
